import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'
const exclusive = (props) => (
    <div>
        <Head>
            <meta name="viewport" content="width=device-width, initial-scale=1"></meta>
            <style amp-custom>
                {`

                @media screen and (max-width: 1024px)
                    {
                        .container_exclusive_banner {
                            background-color: #52bdae;
                            display: block;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                            width:100%;
                            margin: auto;
                        }

                        .right_teal{
                            display:flex;
                        }
                        .left_teal{
                            display:block;
                        }
                        .teal_banner_line1{
                            display:block;
                            width:100%;  
                            padding-top:5%;
                            text-align:center;
                            font-size: 18px;
                            color:white;
                        }
                        .teal_banner_line2{
                            width:100%;
                            text-align:center;
                            color:white;
                            font-size: 18px;
                            display:block;
                        }
                        .teal_banner_line3{
                            font-size:1.7em;
                            width:100%;
                            text-align:center;
                            display:block;
                            font-weight: bold;
                            color:white;
                        }
                        .addtocart_cardone{
                            background-color: white;
                            display:block;
                            margin-left:5%;
                            margin-right:2%;
                            margin-bottom:5%;
                            width:45%;

                        }
                        .addtocart_cardtwo{
                            background-color: white;
                            display:block;
                            margin-right:5%;
                            margin-bottom:5%;
                            width:45%;
                        }
                        .upper{
                            background-color:#e7e6e6 ;
                            display:block;
                            text-align: center;
                            font-weight: bold;
                            margin:auto;
                            color: #58595f;
                            padding: 5% 10% 0% 10%;
                            letter-spacing:2%;
                            font-size:15px;
                        }
                        .permonth{
                            color:black;
                            text-align: center;
                            font-size: 12px;
                            color: #58595f;
                            font-weight: bold;
                            letter-spacing: 1px;
                        }
                        .instant_access{
                            color:black;
                            text-align: center;
                            font-size: 12px;
                            color: #58595f;
                            font-weight: bold;
                            letter-spacing: 1px;
                        }
                        .price{
                            background-color:#e7e6e6 ;
                            margin-top:0px;
                            text-align: center;
                            font-weight: bold;
                            margin-bottom:0px;
                            color: #58595f;
                            padding: 2% 10% 2% 5%;
                            letter-spacing: 1px;
                            font-size: 18px;
                        }
                        .addtocart_button{
                            background-color:#ed3833;
                            color: white;
                            padding:8px;
                            display: block;
                            margin:auto;
                            margin-top:10px;
                            margin-bottom:10px;
                            border-radius: 6px;
                        }
                        .brackets_shit{
                            display:block;
                            margin:auto;
                            width:100%;
                            text-align:center;
                            font-size:13px;
                            color:white;

                        }
                        .container_3buttons{
                            display:flex;
                            font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                        }
                         .benefits_div{
                            display:block;
                            text-align:center;
                            margin:auto;
                         }
                         .benefits{
                            color: #58595f;
                            font-size:12px;
                            letter-spacing:2px;
                            font-weight:bold;
                         }
                         .price_comp_div{
                            display:block;
                            text-align:center;
                            margin:auto;
                            border-right:2px solid white;                            
                         }
                         .price_comp{
                            color: #58595f;
                            font-size:12px;
                            letter-spacing:2px;
                            font-weight:bold;
                         }
                         .faqs_div{
                            display:block;
                            text-align:center;
                            margin:auto; 
                         }
                         .faqs{
                            color: #58595f;
                            font-size:12px;
                            letter-spacing:2px;
                            font-weight:bold;
                         }


                    }


                `}

            </style>
        </Head>
        <body>
            <div class="container_exclusive_banner">
                <div class="left_teal" >
                    <p>
                        <p class="teal_banner_line1"> BECOME AN EXCLUSIVE MEMBER </p>
                        <p class="teal_banner_line2"> AT AN </p>
                        <p class="teal_banner_line3"> INTRODUCTORY PRICE </p> 
                        <p class="brackets_shit">(Adding membership to cart will unlock Exclusive prices instantly)</p>

                    </p>
                </div>
                <div class="right_teal">
                    <div class="addtocart_cardone">
                            <p class="upper"> MONTHLY </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 149/- pm</p>
                            <p class="instant_access">Get instant access 
                                for a full month.</p>
                            <h3 class="price">@ Rs. 149/-</h3>  
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                    <div class="addtocart_cardtwo">
                            <p class="upper"> ANNUAL </p>
                            <p class="upper"> MEMBERSHIP </p>
                            <p class="permonth">Rs. 25/- pm</p>
                            <p class="instant_access">Get instant access 
                                for a full year.</p>
                            <h3 class="price">@ Rs. 299/-</h3>   
                            <button class="addtocart_button">ADD TO CART</button>
                    </div>
                </div>   
                </div>    
            <div class="container_3buttons">
                    <div class="benefits_div">
                            <p class="benefits"> BENEFITS </p>
                    </div>
                    <div class="price_comp_div">
                            <p class="price_comp"> PRICE COMPARISON </p>
                    </div>
                    <div class="faqs_div">
                            <p class="faqs"> FAQS </p>
                    </div>
            </div>    
        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
